/*Table structure for table `sitemail` */

DROP TABLE IF EXISTS `sitemail`;

CREATE TABLE `sitemail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `content` varchar(255) DEFAULT NULL,
  `fromUser` varchar(255) DEFAULT NULL,
  `fromUsername` varchar(255) DEFAULT NULL,
  `sendTime` datetime DEFAULT NULL,
  `status` varchar(255) DEFAULT NULL,
  `toUser` varchar(255) DEFAULT NULL,
  `toUsername` varchar(255) DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

