/*Table structure for table `syspermission` */

DROP TABLE IF EXISTS `syspermission`;

CREATE TABLE `syspermission` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `available` bit(1) NOT NULL COMMENT '是否可用',
  `name` varchar(50) NOT NULL COMMENT '菜单名',
  `parentId` bigint(20) NOT NULL COMMENT '父菜单',
  `parentIds` varchar(100) NOT NULL COMMENT '祖先id',
  `permission` varchar(50) NOT NULL COMMENT '权限标识符',
  `resourceType` enum('menu','button','crudButton') NOT NULL COMMENT '资源权限类型：menu:菜单、button：按钮、crudButton：增删改查按钮',
  `url` varchar(100) DEFAULT NULL,
  `menuIcon` varchar(100) DEFAULT NULL COMMENT '菜单图标',
  `menuOrder` int(2) DEFAULT NULL COMMENT '菜单排序',
  `haveChildren` bit(1) NOT NULL COMMENT '是否为父菜单。0：否。1：是。',
  `menuType` bit(1) DEFAULT NULL COMMENT '菜单类型。0：系统菜单、1：业务菜单',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=245 DEFAULT CHARSET=utf8;

